import React from "react";

import image1 from "../images/music1.png";
import image2 from "../images/music2.png";
import image3 from "../images/music3.png";
import image4 from "../images/music4.png";
import image5 from "../images/music5.png";
import image6 from "../images/music6.png";
import image7 from "../images/music7.png";
import image8 from "../images/music8.png";
import image9 from "../images/music9.png";
import image10 from "../images/music10.png";
import image11 from "../images/music11.png";
import image12 from "../images/music12.png";

function MusicList() {
  return (
    <div className="movieList">
      <div className="row1">
        <img src={image1} />
        <img src={image2} />
        <img src={image3} />
        <img src={image4} />
        <img src={image5} />
      </div>
      <div className="row1">
        <img src={image6} />
        <img src={image7} />
        <img src={image1} />
        <img src={image1} />
        <img src={image1} />
      </div>
      <div className="row1">
        <img src={image1} />
        <img src={image1} />
        <img src={image1} />
        <img src={image1} />
        <img src={image1} />
      </div>
    </div>
  );
}

export default MusicList;
